import React, { useContext } from 'react';
import { Link } from 'react-router-dom';
import { AuthContext } from '../protected/AuthContext';
import { FaShoppingCart, FaSearch } from 'react-icons/fa'; // Importa los íconos necesarios
import './NavBar.css';

const Navbar = () => {
    const { user, logout } = useContext(AuthContext);

    return (
        <nav className="navbar">
            <div className="navbar-left">
                {user ? (
                    <button className="logout-button" onClick={logout}>Cerrar Sesión</button>
                ) : (
                    <Link to="/login" className="navbar-subscribe">INICIO DE SESIÓN</Link>
                )}
            </div>
            <div className="navbar-center">
                <div className="navbar-brand">
                    <Link to="/">| La Tiendita |</Link>
                </div>
                <ul className="navbar-menu">
                    <li><Link to="/products">Productos |</Link></li>
                    {user && user.rolID === 2 && (
                        <>
                            <li><Link to="/admin">Admin Panel</Link></li>
                            <li><Link to="/admin/orders">Order Management</Link></li>
                        </>
                    )}
                </ul>
            </div>
            <div className="navbar-right">
                {user && user.rolID !== 2 && (
                    <>
                        <Link to="/cart" className="navbar-icon"><FaShoppingCart /></Link>
                        <Link to="/order-history" className="navbar-icon"><FaSearch /></Link>
                    </>
                )}
            </div>
        </nav>
    );
};

export default Navbar;
